query QueryRenderersShowQuery(
  $showID: String!
) {
  show(id: $showID) {
    ...Show_show
    __id
  }
}

fragment Show_show on Show {
  id
  name
  description
  press_release
  location {
    __id
    id
    city
    address
    address_2
    coordinates {
      lat
      lng
    }
    day_schedules {
      start_time
      end_time
      day_of_week
    }
  }
  artists {
    __id
    id
    name
    is_followed
  }
  artworks {
    __id
    id
    artist_names
    image {
      id
      url
    }
    price
    availability
    contact_label
  }
  status
  counts {
    artworks
    eligible_artworks
  }
  exhibition_period
  partner {
    __typename
    ... on ExternalPartner {
      name
      __id
    }
    ... on Partner {
      name
    }
    ... on Node {
      __id
    }
  }
  __id
}
